using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{	/// <summary>	/// The NSMetadataQueryResultGroup class represents a collection of grouped attribute results returned by an NSMetadataQuery object.	/// </summary>	/// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSMetadataQueryResultGroup_Class/index.html#//apple_ref/occ/cl/NSMetadataQueryResultGroup"/>	[iOSVersion(5)]	public class NSMetadataQueryResultGroup : NSObject, AnyObject, NSObjectProtocol	{		/// <summary>		/// Returns the query result at a specific index.		/// </summary>		/// <param name="index">The index of the desired result.</param>		[iOSVersion(5)]		[Export("resultAtIndex")]		public AnyObject ResultAtIndex(int index) { return default(AnyObject); }				/// <summary>		/// Returns the attribute name for the receiverâ€™s result group.		/// </summary>		[iOSVersion(5)]		[Export("attribute")]		public string Attribute { get; private set; }				/// <summary>		/// Returns the value of the attribute name for the receiver.		/// </summary>		[iOSVersion(5)]		[Export("value")]		public AnyObject Value { get; private set; }				/// <summary>		/// Returns an array containing the result objects for the receiver.		/// </summary>		[iOSVersion(5)]		[Export("results")]		public AnyObject[] Results { get; private set; }				/// <summary>		/// Returns the number of results returned by the receiver.		/// </summary>		[iOSVersion(5)]		[Export("resultCount")]		public int ResultCount { get; private set; }				/// <summary>		/// Returns an array containing the subgroups of the receiver.		/// </summary>		[iOSVersion(5)]		[Export("subgroups")]		public AnyObject[] Subgroups { get; private set; }	}}